const cons = require("../assets/construction.jpg").default;

const Offer = () => {
  return (
    <div
      style={{
        backgroundImage: `url(${cons})`,
        width: 500,
        height: 500,
        backgroundPosition: "50% 50%",
        backgroundSize: "cover",
        backgroundRepeat: "no-repeat",
        margin: 20,
      }}
    >
      <h3 style={{ color: "white" }}>Construction</h3>
    </div>
  );
};

const styles = {
  image: {},
};

export default Offer;
